import { Server } from "ws";

const wsserver = new Server({ host: "127.0.0.1", port: 8000 }, () => {
	console.log("WebSocket server started on ws://127.0.0.1:8000");
});

wsserver.on('connection', (socket) => {
	console.log("socket connected!");
	socket.on('message', (data) => {
		socket.send(`${data}`);
	});
})
